var app=vueContext({el:"#app",data:function(){return{message:"Hello From Vue",filter:{OrderByDirection:"Asc",OrderBy:1,ItemsPerPage:50,CurrentPage:1,TotalPages:150,Loading:!1},items:[]}},watch:{},computed:{},methods:{getList:function(){if(!this.filter.Loading)return this.filter.Loading=!0,apiHandler.Get("user",this.filter).then(n=>{this.items=n,this.filter.TotalPages=n.TotalPages,this.filter.Loading=!1})},goToDetails:function(n){window.location="/admin/account/user/userdetails/"+n}},created:function(){this.getList()},mounted:function(){}});